import React from "react";
import Header from "../../../components/Header";
import Nav from "../../../components/Nav";
import Tabs from "../../../components/Tabs";


function UIPDA02013() {

  return (
    <>
        {/* #wrap */}
        <div id="wrap">
          <Header />
          <div id="container">
            <div className="content" data-role="content">
              <Nav />
              <Tabs />
            </div>
          </div>
        </div>
        {/* //#wrap */}
    </> 
    
  )
}

export default UIPDA02013;
